//Calculates signature and adds it to headers. Returns headers.
func awsrek_AddSignature(headers map, json_payload string, now_time int) map {
	var secret string
	secret = awsrek_getSecretKey()

	var kDate string
	kDate = HMac(secret, Date("20060102", now_time), true)

	var kRegion string
	kRegion = HMac(kDate, "us-east-1", true)

	var kService string
	kService = HMac(kRegion, "rekognition", true)

	var kReq string
	kReq = HMac(kService, "aws4_request", true)

	var sdt string
	sdt = Date("20060102", now_time)

	var scope string
	scope = Sprintf("%s/us-east-1/rekognition/aws4_request", sdt)

	var canon string
	canon = awsrek_createCanonicalRequest(headers, json_payload)

	var to_sign string
	to_sign = awsrek_createStringToSign(headers["x-amz-date"], scope, canon)

	var signature string
	signature = HMac(kReq, to_sign, false)

	var headers_keys array
	headers_keys = SortedKeys(headers)

	var signed_headers string
	signed_headers = Join(headers_keys, ";")

	var authorization string
	authorization = Sprintf("AWS4-HMAC-SHA256 Credential=%s/%s/us-east-1/rekognition/aws4_request, SignedHeaders=%s, Signature=%s", 
							awsrek_getKeyId(), sdt, signed_headers, signature)

	headers["authorization"] = authorization

	return headers
}

//Makes requests to AWS API specified method. Returns json string.
func awsrek_doRequest(aws_method string, json_payload string) string {
    var request_link string
    request_link = Sprintf("%s%s", awsrek_getBaseLink())

	var trimmed_payload string
	trimmed_payload = TrimSpace(json_payload)

	var content_length int
	content_length = Size(trimmed_payload)

	var now_time int
	now_time = $time - 36000

	var headers map
	headers = awsrek_AddSignature(awsrek_buildHeaders(now_time, aws_method, content_length), trimmed_payload, now_time)

	var ret string
	ret = HTTPPostJSON(awsrek_getBaseLink(), headers, trimmed_payload)

    return ret
}

//Removes mime type from png and jpg. Returns base64 string.
func awsrek_stripJpegMime(image string) string {
	return Replace(Replace(image, "data:image/jpeg;base64,", ""), "data:image/png;base64,", "")
}

//Adding faces to collection in amazon aws
func awsrek_indexFaces(avatar string, id int) map {
    var json_payload string
	json_payload = Sprintf("{
		   \"CollectionId\": \"apla_rta_india_test\",
		   \"DetectionAttributes\": [ \"ALL\" ],
		   \"ExternalImageId\": \"%d\",
		   \"Image\": { 
			  \"Bytes\": \"%s\"
		   }
		}", id, awsrek_stripJpegMime(avatar))

	//DBInsert("debug", "data", json_payload)
	var resp map
	resp = JSONToMap(awsrek_doRequest("IndexFaces", json_payload))	
	return resp
}

//Searches face in AWS collection and returns json string.
func awsrek_searchFacesByImage(image string) string {
	var json_payload string
	json_payload = Sprintf("{
		   \"CollectionId\": \"apla_rta_india_test\",
		   \"Image\": { 
			  \"Bytes\": \"%s\"
		   },
		   \"MaxFaces\": 1
		}", awsrek_stripJpegMime(image))

	return awsrek_doRequest("SearchFacesByImage", json_payload)
}

//Searches face in AWS collection and returns member_id and recognition confidence in map
func awsrek_getMemberIdByFace(face_img string) map {
    var json string
    json = awsrek_searchFacesByImage(face_img)

    var resp map
	resp = JSONToMap(json)	

	var frecords array
	frecords = resp["FaceMatches"]

	var face map
	face = frecords[0]
	face = face["Face"]

	var result map
	result["id"] = face["ExternalImageId"]
	result["confidence"] = face["Confidence"]

	return result
}

//Detects objects on image and returns json string.
func awsrek_detectLabels(image string) string {
	var json_payload string
	json_payload = Sprintf("{
		   \"Image\": { 
			  \"Bytes\": \"%s\"
		   },
		   \"MinConfidence\": 70
		}", awsrek_stripJpegMime(image))

	return awsrek_doRequest("DetectLabels", json_payload)
}

//Detects objects on image and returns map of objects.
func awsrek_getLabels(img string) map {
    var json string
    json = awsrek_detectLabels(img)
    //DBInsert("debug", "data", json)
    var resp map
	resp = JSONToMap(json)

	var labels array
	labels = resp["Labels"]

	var i int
	var labels_len int
	labels_len = Len(labels)
	var results map
	while(i < labels_len) {
		var label map
		label = labels[i]
		results[label["Name"]] = Float(label["Confidence"])
		i = i + 1
	}
	return results
}

contract auto_sales_add {
    data {
        auto_id int
        engine_number string
        chassis_number string
        isRandom int
        member_photo_dealer string "image"
    }

    conditions {}

    action {
		// if its a random buyer, get photo from the table
        if ($isRandom == 1){
            $photo_map = DBFind("random_buyer").Where("flag_selection=$", 1).Row()
            if ($photo_map["id"] == nil){
                warning "Photo not found"
            }
            $member_photo_dealer = string($photo_map["buyer_photo"]) 
        }

		// start recognizing
        var labels map
        labels = awsrek_getLabels($member_photo_dealer)

        var labels_keys array
        labels_keys = GetMapKeys(labels)

        var body_styles array
        body_styles = DBFind("car_classification")

        var i int
        var body_styles_len int
        body_styles_len = Len(body_styles)
        var labels_keys_len int
        labels_keys_len = Len(labels_keys)
        var found_body_styles array
        var counter int

        while (i < body_styles_len) {
            var k int
            var body_style map
            body_style = body_styles[i]
            while (k < labels_keys_len) {
                if (labels_keys[k] == body_style["body_style"]) {
                    found_body_styles[counter] = Sprintf("%s - %s", body_style["body_style"], Str(labels[body_style["body_style"]]))
                    counter = counter + 1
                    k = k + 1
                    break
                }
                k = k + 1
            }
            i = i + 1
        }

        i = Len(found_body_styles)
        while (i < 4) {
            found_body_styles[i] = ""
            i = i + 1
        }

		// get data after recognition
        $member = awsrek_getMemberIdByFace($member_photo_dealer)
        $member_id = $member["id"]
        $face_recognition_confidence = Float($member["confidence"])

		// search member
		$member_map = DBFind("recognition_members").Where("recognition_id=$", $member_id).Row()
		if ($member_map["id"] == nil) {
			warning "Member not recognized"
		}

		// search auto
		$auto_map = DBFind("registry_auto").Where("id=?", $auto_id).Row()
		if ($auto_map["id"] == nil) {
			warning "Auto not found"
		}

		// create a protocol
		DBInsert("registration_protocols", "member_id,member_name,member_photo,auto_id,auto_manufacturer,auto_model,engine_number,chassis_number,auto_photo,member_photo_dealer,timestamp member_photo_dealer_date,delete,status,face_recognition_confidence_double, body_type_1, body_type_2, body_type_3, body_type_4",
			$member_id, string($member_map["member_name"]), string($member_map["avatar"]),
			$auto_id, string($auto_map["manufacturer"]), string($auto_map["model"]), $engine_number, $chassis_number, string($auto_map["auto_photo"]),
			$member_photo_dealer, $time, 0, 0, $face_recognition_confidence, found_body_styles[0], found_body_styles[1], found_body_styles[2], found_body_styles[3])
    }
}

